+package heal;
+
+import java.awt.Rectangle;
+
+public class Path  {
+
+    final XYList xyList;
+    private Rectangle bounds = new Rectangle(Integer.MAX_VALUE,Integer.MAX_VALUE,Integer.MIN_VALUE,Integer.MIN_VALUE);
+    Path(XYList xyList){
+        this.xyList =xyList;
+    }
+
+    public void add(int x, int y){
+        if (xyList.length()>0) {
+            XYList.XY lastxy = xyList.xy(xyList.length() - 1);
+            add(lastxy.x(), lastxy.y(), x, y);
+        }else{
+            ( (XYListImpl)xyList).add(x, y);
+            bounds.add(x,y);
+        }
+    }
+    public Path close(){
+        var first = xyList.xy(0);
+        add(first.x(), first.y());
+        return this;
+    }
+
+    int x1(){
+        return bounds.x;
+    }
+    int y1(){
+        return bounds.y;
+    }
+    int width(){
+        return bounds.width;
+    }
+    int height(){
+        return bounds.height;
+    }
+    int x2(){
+        return x1()+width();
+    }
+    int y2(){
+        return y1()+height();
+    }
+
+    private void add(int x1, int y1, int x2, int y2) {
+        int x = x1;
+        int y = y1;
+        int w = x2 - x;
+        int h = y2 - y;
+        int dx1 = Integer.compare(w, 0);
+        int dy1 = Integer.compare(h, 0);
+        int dx2 = dx1;
+        int dy2 = 0;
+        int longest = Math.abs(w);
+        int shortest = Math.abs(h);
+        if (longest <= shortest) {
+            longest = Math.abs(h);
+            shortest = Math.abs(w);
+            dy2 = Integer.compare(h, 0);
+            dx2 = 0;
+        }
+        int numerator = longest >> 1;
+        for (int i = 0; i <= longest; i++) {
+
+            ( (XYListImpl)xyList).add(x, y);
+            bounds.add(x,y);
+            numerator += shortest;
+            if (numerator >= longest) {
+                numerator -= longest;
+                x += dx1;
+                y += dy1;
+            } else {
+                x += dx2;
+                y += dy2;
+            }
+        }
+    }
+}

